import React, { useState, useEffect } from 'react';
import axios from 'axios';
import CreateForm from '../components/CRUD/CreateForm';
import ReadForm from '../components/CRUD/ReadForm';
import UpdateForm from '../components/CRUD/UpdateForm';
import DeleteForm from '../components/CRUD/DeleteForm';
import '../styles.css';

const API_URL = 'http://localhost:5000';

const AdminForm = () => {
  const [records, setRecords] = useState([]);
  const [selectedRecordId, setSelectedRecordId] = useState('');
  const [showCreateForm, setShowCreateForm] = useState(false);
  const [showReadForm, setShowReadForm] = useState(false);
  const [showUpdateForm, setShowUpdateForm] = useState(false);
  const [showDeleteForm, setShowDeleteForm] = useState(false);

  useEffect(() => {
    const fetchRecords = async () => {
      try {
        const response = await axios.get(`${API_URL}/api/my_tour`);
        setRecords(response.data);
      } catch (error) {
        console.log('Ошибка получения записей', error);
      }
    };

    fetchRecords();
  }, []);

  const handleToggleCreateForm = () => {
    setShowCreateForm(!showCreateForm);
    setShowReadForm(false);
    setShowUpdateForm(false);
    setShowDeleteForm(false);
  };

  const handleToggleReadForm = () => {
    setShowReadForm(!showReadForm);
    setShowCreateForm(false);
    setShowUpdateForm(false);
    setShowDeleteForm(false);
  };

  const handleToggleUpdateForm = () => {
    setShowUpdateForm(!showUpdateForm);
    setShowCreateForm(false);
    setShowReadForm(false);
    setShowDeleteForm(false);
  };

  const handleToggleDeleteForm = () => {
    setShowDeleteForm(!showDeleteForm);
    setShowCreateForm(false);
    setShowReadForm(false);
    setShowUpdateForm(false);
  };

  const handleReadRecord = (id) => {
    setSelectedRecordId(id);
    setShowReadForm(true);
  };

  const handleUpdateRecord = (id) => {
    setSelectedRecordId(id);
    setShowUpdateForm(true);
  };

  const handleDeleteRecord = (id) => {
    setSelectedRecordId(id);
    setShowDeleteForm(true);
  };

  const handleCreateRecord = () => {
    setShowCreateForm(true);
  };

  return (
    <div className='admin-title'>
      <h2>Управление турами</h2>
      <div className="button-group">
        <button onClick={handleToggleCreateForm}>Создать запись</button>
        <button onClick={handleToggleReadForm}>Просмотреть записи</button>
        <button onClick={handleToggleUpdateForm}>Обновить запись</button>
        <button onClick={handleToggleDeleteForm}>Удалить запись</button>
      </div>
      {showCreateForm && <CreateForm />}
      {showReadForm && <ReadForm recordId={selectedRecordId} />}
      {showUpdateForm && <UpdateForm recordId={selectedRecordId} />}
      {showDeleteForm && <DeleteForm recordId={selectedRecordId} />}
      <table>
        <thead>
          <tr>
            <th>Название</th>
            <th>Описание</th>
            <th>Длительность</th>
            <th>Вид активности</th>
            <th>Дата</th>
            <th>Цена</th>
            <th>Действия</th>
          </tr>
        </thead>
        <tbody>
          {records.map((record) => (
            <tr key={record.id}>
              <td>{record.title}</td>
              <td>{record.description}</td>
              <td>{record.duration}</td>
              <td>{record.activity}</td>
              <td>{record.date}</td>
              <td>{record.price}</td>
              <td>
                <button onClick={() => handleReadRecord(record.id)}>Read</button>
                <button onClick={() => handleUpdateRecord(record.id)}>Update</button>
                <button onClick={() => handleDeleteRecord(record.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminForm;
